// List of tools to highlight with the special effect
const specialTools = [
    "grok", "suno", "gamma", "qwenlm", "adobe firefly--free", 
    "turbolearn ai", "edraw ai", "heygen", "kittl", "slideteam"
];

// Function to render tools (unchanged)
function renderTools() {
    const grid = document.getElementById('toolsGrid');
    grid.innerHTML = '';

    aiTools.forEach((tool, index) => {
        const card = document.createElement('div');
        card.classList.add('tool-card');
        if (specialTools.includes(tool.name.toLowerCase())) {
            card.classList.add('special-card');
        }
        const badgeHtml = tool.badge ? `<span class="badge">${tool.badge}</span>` : '';
        card.innerHTML = `
            <div class="tool-header">
                <img src="${tool.logo}" alt="${tool.name} Logo" class="tool-logo">
                <h2>${tool.name} ${badgeHtml}</h2>
            </div>
            <p>${tool.description.substring(0, 60)}...</p>
        `;
        card.addEventListener('click', () => showModal(index));
        grid.appendChild(card);
    });
}

// Tool Modal Functionality (unchanged)
const modal = document.getElementById('toolModal');
const closeModal = document.getElementById('closeModal');
const modalTitle = document.getElementById('modalTitle');
const modalDescription = document.getElementById('modalDescription');
const modalLink = document.getElementById('modalLink');

function showModal(index) {
    const tool = aiTools[index];
    modalTitle.textContent = tool.name;
    modalDescription.textContent = tool.description;
    modalLink.href = tool.link;
    modalLink.textContent = `Visit ${tool.name}`;
    modal.style.display = 'flex';
}

closeModal.addEventListener('click', () => {
    modal.style.display = 'none';
});

window.addEventListener('click', (e) => {
    if (e.target === modal) {
        modal.style.display = 'none';
    }
});

// Add new tool (unchanged)
function addTool(name, description, link, badge = null, logo = "https://via.placeholder.com/50x50") {
    aiTools.push({ name, description, link, badge, logo });
    renderTools();
}

// Welcome Modal Functionality
const welcomeModal = document.getElementById('welcomeModal');
const closeWelcomeModal = document.getElementById('closeWelcomeModal');
const welcomeOkBtn = document.getElementById('welcomeOkBtn');

// Show welcome modal on page load
window.addEventListener('load', () => {
    welcomeModal.style.display = 'flex';
});

// Close welcome modal on "X" click
closeWelcomeModal.addEventListener('click', () => {
    welcomeModal.style.display = 'none';
});

// Close welcome modal on "OK" button click
welcomeOkBtn.addEventListener('click', () => {
    welcomeModal.style.display = 'none';
});

// Close welcome modal when clicking outside
window.addEventListener('click', (e) => {
    if (e.target === welcomeModal) {
        welcomeModal.style.display = 'none';
    }
});

// Initial render
renderTools();

